				["29438"] = {
					["Text"] = {
						["1"] = "Credi di essere brava con le armi? Tieni il grilletto facile?\n\nPerché nun metti alla prova le abilità tue, allora? Costa solo nu gettone dei giochi.\n\nCoraggio, vediamo come te la cavi.",
