				["NumQuests"] = 9,
				["11886"] = {
					["LeaderBoards"] = {
						{
							["1"] = "0/1 Corrispondenza del Crepuscolo recuperata",
							["count"] = 3,
							["3"] = false,
							["2"] = "item",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:11886:-1|h[Attività insolita]|h|r",
					["Text"] = {
						["1"] = "Sciamana, alcuni di noi devono pensare a questioni più delicate delle celebrazioni.\n\nQuando la festa ha avuto inizio, dalla Spiaggia di Zoram ci hanno riferito che l'attività del Culto del Crepuscolo è aumentata. Non può essere una coincidenza: le origini di questa festività risiedono nei poteri adorati da quei folli. Raggiungi l'accampamento fra le rovine a sud dell'ingresso degli Abissi di Fondocupo. Convinci i Cultisti a consegnarti delle informazioni. Con la forza, se necessario. Usa questo Totem per evocare una guida, quando sarai sul posto.",
						["count"] = 2,
						["2"] = "Raggiungi il nuovo Accampamento del Crepuscolo, a sud dell'entrata degli Abissi di Fondocupo sulla Spiaggia di Zoram, nella regione di Valtetra. Recupera la Corrispondenza del Crepuscolo dai Cultisti, quindi usa il Totem Luminoso per evocare la Guida del Circolo della Terra.",
					},
					["RewardXP"] = 1650,
					["Rewards"] = {
						{
							["1"] = "Fiore Bruciante",
