							["2"] = "event",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:11731:-1|h[Lanciare le torce]|h|r",
					["RewardMoney"] = 1300,
					["Rewards"] = {
						{
							["1"] = "Fiore Bruciante",
							["count"] = 6,
							["2"] = "Interface\\ICONS\\INV_SummerFest_FireFlower.blp",
							["5"] = true,
							["4"] = -1,
							["3"] = 5,
							["6"] = "|cffffffff|Hitem:23247:0:0:0:0:0:0:0:21:264:0:0:0|h[Fiore Bruciante]|h|r",
						}, -- [1]
					},
					["Failed"] = true,
					["Text"] = {
						["1"] = "Così vuoi diventare una giocoliera, eh? Ma ne hai la stoffa? La destrezza? I riflessi? Il... coraggio? Se credi di sì, iniziamo con un piccolo addestramento!\n\nPrendi queste torce e corri al falò. Vedrai dei bracieri con degli indicatori sopra. Lancia una torcia contro uno di questi bracieri segnalati. Dovrai essere veloce e colpirli prima che l'indicatore svanisca, altrimenti il lancio non sarà conteggiato!\n\nColpisci un numero sufficiente di bracieri prima che scada il tempo e torna qui... per la lezione successiva.",
						["count"] = 2,
						["2"] = "Supera la prova di lancio delle torce, poi parla con il Maestro Mangiafuoco.",
					},
				},
