					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Hai già dimostrato le tue capacità in passato, ma le terre selvagge di Draenor sono di un livello superiore. Sconfiggi gli allenatori Cymre Lamafulgida a Gorgrond, Vesharr nelle Guglie di Arakk, Tarr il Terribile a Nagrand, Taralune a Talador, Gargra nella Landa di Fuocogelo o Ashlei nella Valle di Torvaluna per provare la supremazia delle tue mascotte. Puoi anche sconfiggere uno degli allenatori in visita, Erris la Collezionista o Kura Zoccolo Tonante nella tua Guarnigione.\n\nSconfiggili per dimostrare il tuo valore su Draenor.",
