				["34028"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Cosa sta combinando l'Orda di Ferro con la tecnologia dei Ferroscuro? Conosco la persona giusta a cui potremmo chiedere informazioni!\n\nThaelin Forgiacupa è un abilissimo ingegnere del Clan Ferroscuro che ci sta dando un grande aiuto qui su Draenor e che forse hai già incontrato durante i tuoi viaggi.\n\nSi dice che abbia costruito un bunker da qualche parte a Gorgrond, una bottega segreta, per così dire. Se riuscissi a trovarlo, potrebbe aiutarti a scoprire qualcosa riguardo a questa faccenda.\n\nFai attenzione però: i Ferroscuro dicono di essere nostri alleati, ma non mi fido per niente di loro.",
						["count"] = 2,
						["2"] = "Trova la Officina di Thaelin a Gorgrond.",
