					},
					["Link"] = "|cffffff00|Hquest:34028:100|h[Qualcosa di familiare...]|h|r",
				},
				["37148"] = {
					["LeaderBoards"] = {
						{
							["1"] = "0/1 Fiammola dei Bastioni catturata",
							["3"] = false,
							["count"] = 3,
							["2"] = "item",
						}, -- [1]
						{
							["1"] = "0/1 Signora della Guerra Zaela uccisa",
							["3"] = false,
							["count"] = 3,
							["2"] = "monster",
						}, -- [2]
					},
					["Link"] = "|cffffff00|Hquest:37148:100|h[L'avventura di Oralius]|h|r",
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Sempre all'avventura, io e Winky! Questa è vita, parola mia! Niente più aria soffocante da respirare e dozzine di Ogre da uccidere!\n\n<Oralius si massaggia la pancia.>\n\nPurtroppo, però, abbiamo lasciato un bel disastro nei Bastioni di Roccianera. Un sacco di quegli Orchi ricoperti di ferro accompagnati da Proto-Drachi sono marciati entrati da sud e hanno conquistato quel luogo.\n\nIl buon vecchio Winky non ha retto ai sensi di colpa e ha deciso di tornare indietro per fermarli!\n\nO... per UNIRSI a loro! Winky, brutto traditore figlio di un Orco! Devi fermarlo!",
						["count"] = 2,
						["2"] = "Cattura una Fiammola dei Bastioni nei Bastioni di Roccianera Superiori.",
					},
					["Rewards"] = {
