				["36010"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "L'Orda di Ferro, e in particolare il Clan Lame Ardenti, ha forgiato un'insolita alleanza con gli antichi elementali di Draenor. Sono in grado di lavorare il metallo con tecniche che nemmeno io sono in grado di comprendere appieno.\n\nO meglio, non ancora...\n\nPàndorella, uccidi l'artigiana di più alto livello delle Lame Ardenti, la Domafiamme Ka'graz. Si trova nel cuore della Forgia Nera nella Fonderia dei Roccianera, una zona conosciuta con il nome Fonte Ardente. Se siamo fortunati, i suoi segreti saranno codificati in un Tomo della Domafiamme.",
						["count"] = 2,
						["2"] = "Recupera il Tomo della Domafiamme dalla Domafiamme Ka'graz nella Fonderia dei Roccianera.",
