				["36012"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Pàndorella, durante l'attacco a Karabor, le navi dell'Orda di Ferro hanno saccheggiato o affondato la maggior parte dei vascelli della flotta orientale dei Draenei. Hanno rubato un manufatto di estimabile valore, un autentico Globo Taumaturgico Draenoriano.\n\nDevo riaverlo, quegli Orchi non hanno idea di cos'hanno tra le mani!\n\nLe mie fonti indicano che il globo si trova a bordo di una nave in manutenzione nella Grotta del Terrore, al di sotto della Fonderia dei Roccianera. Perlustra la nave e le zone limitrofe alla ricerca dello Scrigno degli Sha'tari che conteneva il globo. Dobbiamo riaverlo!",
