					["Text"] = {
						["1"] = "In qualche modo, il Clan Roccianera è riuscito a forgiare un'alleanza con le creature di fuoco e pietra. Devo scoprire come ci sono riusciti!\n\nPerlustra la Fonderia dei Roccianera alla ricerca di alcune tavolette di pietra datate all'era preistorica di Draenor. Ormai probabilmente saranno ridotte a un cumulo di frammenti che dovrai recuperare e riassemblare a mano. Cerca le rune elementali che i membri di più alto livello dell'Orda di Ferro portano sempre con sé, ricostruisci le tavolette e portale da me. Userò il loro potere per incrementare le capacità del tuo anello!",
