					["Text"] = {
						["1"] = "Se non ti secca, starei facendo di tutto per impedire che i nostri mondi collassino nel Vuoto... DI NUOVO.\n\nOh, giusto, mi hai aiutato l'ultima volta, non è così? Bene, tempismo perfetto. Ho bisogno di una nuova Chiave del Portale.\n\nAllora? Avanti! Gli infiniti orrori dell'abisso non aspetteranno la fine del tuo pisolino! Avere così tanti tentacoli deve renderli davvero nervosi.",
