				["38254"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Svariati Orchi hanno iniziato a lamentarsi apertamente da quando Gul'dan ha assunto il controllo. Alcuni sono stati fatti prigionieri. Tra questi vi è un prodigio dell'ingegneria: Solog Roark, \"Il Carpentiere Navale di Ferro\". Stiamo parlando di colui che ha realizzato questa Darsena, per non parlare delle grandi corazzate della flotta orchesca. Se i miei esploratori sono nel giusto, si trova su quel treno prigione e potrebbe essere pronto a disertare!\n\nRecupera degli esplosivi e raggiungi Yrel vicino al treno a sud-est!",
