				["34655"] = {
					["RewardMoney"] = 138000,
					["Text"] = {
						["1"] = "La mia gente è fuggita dalla nostra terra a gambe levate. Io vendo monili per facilitare il loro viaggio.\n\nMa vedo che tu non sei interessata ai miei prodotti... No, tu cerchi risposte.\n\nSkettis si trova poco più avanti. Un tempo era una grande città, costruita da Terokk come rifugio per gli esiliati, ma ora è in rovina.\n\nLaggiù vive un vecchio narrastorie, un Custode delle Pergamene di nome Reshad. Trovalo e digli queste parole: \"Le ombre si addensano\". Capirà che sei un'amica.\n\nOra vai, la tua presenza mi rovina gli affari.",
						["count"] = 2,
						["2"] = "Recita le parole d'ordine a Reshad presso Skettis.",
					},
					["LeaderBoards"] = {
						{
