				["33137"] = {
					["Text"] = {
						["1"] = "L'Isola Senza Tempo è sede di uno speciale torneo ideato per mettere alla prova le abilità di comando dei suoi partecipanti. Coloro che dimostreranno di esserne degni avranno l'opportunità di ottenere il rispetto di un'incarnazione di virtù, la progenie dei Celestiali in persona.\n\nOgni volta che vincerai un torneo, ti onorerò con una nuova moneta cerimoniale. Quando ne avrai accumulate abbastanza, parla di nuovo con me e discuteremo delle tue prossime ricompense.",
