				["12842"] = {
					["RewardXP"] = 12250,
					["Text"] = {
						["1"] = "Il marchio della guerra è impresso in maniera indelebile sulla tua anima, Cavaliere della Morte. Hai imparato l'arte oscura Forgiarune, grazie alla quale potrai incidere rune del potere sulle tue armi.\n\nBisogna prepararsi per la battaglia. Torna a una delle Forge delle Rune, qui nel Cuore di Acherus, e usa il potere Forgiarune per decorare la tua arma con una runa del potere!\n\nTorna da me quando la tua lama brillerà di energia oscura!",
						["count"] = 2,
						["2"] = "L'Istruttore Razuvious nella Roccaforte d'Ebano ti ha ordinato di usare la tua abilità Forgiarune per incidere una runa sulla tua Lama dell'Anima Runica.\n\nPuoi sostituire l'incisione sull'arma in qualsiasi momento, a patto di trovarti nei pressi di una Forgia delle Rune.",
