					["Link"] = "|cffffff00|Hquest:26842:12|h[Invasione di Gnoll]|h|r",
					["RewardMoney"] = 500,
					["Text"] = {
						["1"] = "Salute a te, Druida. Abbiamo un problema e vorrei chiederti di darci una mano.\n\nSi tratta degli Gnoll. Ce ne sono una marea che si aggirano per le colline a ovest della città. La cosa non costituirebbe un problema, se non fosse che non ci sono mai stati Gnoll a Loch Modan.\n\nSono curioso di sapere da dove sono sbucati, ma non abbastanza da chiederglielo di persona. Sbarazzatene. Portami una prova che li hai uccisi e ti pagherò una lauta taglia.",
