						}, -- [3]
					},
					["Text"] = {
						["1"] = "Devo metterti in guardia, Àsià. Tutto questo deve restare tra noi. I Satiri ci causano già troppo imbarazzo, e per di più uno di loro si è avvicinato troppo alle nostre terre.\n\nSi chiama Sire Melenas. Abita nella vicina caverna di Vilroccia, a nord, dove ha radunato un folto gruppo di Guerrieri Grell. Il suo cuore è nero come la notte, e sta macchinando qualcosa di davvero malvagio.\n\nDevi trovarlo nella sua caverna a nord di qui e portarmi la sua testa.",
