					},
					["Link"] = "|cffffff00|Hquest:486:9|h[Ursal il Mazzuolatore]|h|r",
					["RewardMoney"] = 600,
					["Text"] = {
						["1"] = "È giunto il momento di salvare i Druidi dell'Artiglio. Se falliamo, Àsià, dormiranno per sempre.\n\nDevo preparare le Reliquie del Risveglio e compiere il rituale. Affinché possa avere successo, la bestia maledetta che ha causato tutto questo deve essere uccisa.\n\nÈ stato Ursal il Mazzuolatore che si è intromesso nel richiamo dei nostri fratelli ed è Ursal il Mazzuolatore che ora deve pagare affinché possano essere liberi. Dirigiti lungo la strada a nord-ovest e trova il sentiero a nord che conduce nella Faglia Infida. Lì troverai il covo di Ursal.",
						["count"] = 2,
