					["Link"] = "|cffffff00|Hquest:26860:12|h[I Sanguinacci di Thelsamar]|h|r",
					["RewardMoney"] = 500,
					["Text"] = {
						["1"] = "Tra bambini che vanno e vengono e operai degli scavi che rientrano dopo un duro giorno di lavoro, qui non mancano mai le bocche da sfamare. Siamo famosi per i nostri Sanguinacci. Suppongo tu non li abbia mai assaggiati, vero?\n\nBe', qui bisogna guadagnarsi il pane quotidiano e non pensare che solo perché sei una capace Druida, tu faccia eccezione.\n\nProcurami della Fesa d'Orso fresca e lascia che sia io a cucinare!",
