					},
				},
				["25998"] = {
					["Text"] = {
						["1"] = "Stando ai piani che hai rubato, i Ferroscuro starebbero progettando un attacco su larga scala contro l'Aerodromo di Forgiardente! Il concilio ha spostato la maggior parte delle nostre forze a Dun Morogh per far fronte all'instabilità causata dal Cataclisma, indebolendo le nostre difese all'Aerodromo.\n\nCi serve un modo per farti raggiungere in fretta l'Aerodromo. Prendi la strada a ovest verso la Cava di Gol'Bolar e cerca Mathel Chiavemarcia. Dovrebbe avere una macchina volante che fa al caso tuo. Va'!",
						["count"] = 2,
						["2"] = "Sali sulla Macchina Volante di Mathel alla Cava di Gol'Bolar e parla con il Comandante Spaccapietra all'Aerodromo di Forgiadente.",
