					["RewardXP"] = 85,
					["Link"] = "|cffffff00|Hquest:25998:10|h[Raggiungere l'Aerodromo]|h|r",
				},
				["13636"] = {
					["RewardMoney"] = 400,
					["Text"] = {
						["1"] = "Devi portare degli ordini al Montanaro Piccatonante all'Avamposto di Algaz. Se la cosa non ti crea problemi, segui la strada che va a nord-ovest e vedrai subito il fortilizio principale.\n\nSe avrai voglia di aiutarlo a eseguire i suoi ordini, ti ricompenseremo anche per quello.",
						["count"] = 2,
						["2"] = "Porta al Montanaro Piccatonante all'Avamposto di Algaz i suoi ordini.",
					},
					["RewardXP"] = 675,
					["Link"] = "|cffffff00|Hquest:13636:13|h[Gli ordini di Piccatonante]|h|r",
				},
				["25118"] = {
					["LeaderBoards"] = {
						{
							["1"] = "4/8 Guardinghi delle Foreste uccisi",
							["count"] = 3,
							["3"] = false,
							["2"] = "monster",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:25118:13|h[Alla ricerca dei guardinghi]|h|r",
					["RewardMoney"] = 600,
					["Text"] = {
						["1"] = "Non so tu, ma a me non piacciono molto i ragni. E ancor meno quelli che sono più grandi di me. Loch Modan è un luogo stupendo, ma devo confessare che farei volentieri a meno di quegli orribili esseri che se ne vanno in giro.\n\nSenti, io ho un po' di monete da parte e tu mi sembri in gamba. Se uccidi un po' di quegli esseri, ti ricompenserò adeguatamente.",
						["count"] = 2,
						["2"] = "Uccidi 8 Guardinghi delle Foreste.",
					},
					["RewardXP"] = 900,
				},
				["13648"] = {
					["LeaderBoards"] = {
						{
							["1"] = "0/1 Gorick Spillabirra ucciso",
							["count"] = 3,
							["3"] = false,
							["2"] = "monster",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:13648:12|h[Ricercato: la Spia Ferroscuro]|h|r",
					["RewardMoney"] = 1000,
					["Text"] = {
						["1"] = "Una Spia Ferroscuro si è infiltrata in città, ha rubato dei documenti alla Lega degli Esploratori e ora si nasconde nelle vicinanze. L'ultima volta è stato avvistato in cima alla collina a sud della città.\n\nC'è una bella ricompensa che aspetta chiunque lo consegni alla giustizia. Vivo o morto... Preferibilmente morto.",
						["count"] = 2,
						["2"] = "Uccidi Gorick Spillabirra.",
					},
					["RewardXP"] = 1150,
				},
				["2438"] = {
					["LeaderBoards"] = {
						{
							["1"] = "0/1 Acchiappasogni di Smeraldo recuperato",
							["count"] = 3,
							["3"] = false,
							["2"] = "item",
						}, -- [1]
					},
					["Link"] = "|cff808080|Hquest:2438:6|h[L'acchiappasogni di smeraldo]|h|r",
					["RewardMoney"] = 100,
					["Text"] = {
						["1"] = "Una volta Gaerolas Talvethren, il Custode dei Druidi dell'Eremo di Ban'ethil, mi diede un acchiappasogni di smeraldo. Questo potente amuleto è in grado di assorbire energia dal Sogno di Smeraldo, portando fortuna al suo possessore.\n\nPurtroppo non sono riuscito a recuperarlo dalla mia credenza a Brezzastella... Anche se un tempo Brezzastella era un luogo tranquillo, oggi è invaso dalla corruzione dei Mezzorsi che vi risiedono.\n\nVorresti recuperare tu il mio acchiappasogni, Druida?",
						["count"] = 2,
						["2"] = "Recupera l'Acchiappasogni di Smeraldo.",
					},
					["RewardXP"] = 240,
				},
				["NumQuests"] = 11,
				["28490"] = {
					["Text"] = {
						["1"] = "Per ordine di Sua Altezza Reale, Re Varian Wrynn, tutti i cittadini dell'Alleanza idonei devono fare rapporto alla Sacerdotessa Alinore Radargento a Lor'danel nella regione di Rivafosca.\n\nGli abitanti di Lor'danel hanno bisogno del vostro aiuto per prendersi cura dei superstiti della distruzione di Auberdine e difendere la città dal Martello del Crepuscolo. Parlate con Vesprystus, il maestro degli ippogrifi di Rut'theran fuori Darnassus, ed egli organizzerà un volo per Rivafosca.\n\nPer la gloria e l'onore dell'Alleanza!",
						["count"] = 2,
						["2"] = "Fai rapporto alla Sacerdotessa Alinore Radargento a Lor'danel nella regione di Rivafosca.",
					},
					["RewardXP"] = 85,
					["Link"] = "|cffffff00|Hquest:28490:10|h[Chiamata alle armi: Rivafosca!]|h|r",
				},
			},
