				["14348"] = {
					["Text"] = {
						["1"] = "Olkijyh, guarda, arrivano quelli grossi... li chiamano Abomini. Non sono facili da eliminare, dunque non provare a farlo da sola.\n\nMi è venuta un'idea... è talmente folle che potrebbe funzionare. O probabilmente finirà col farti ammazzare, se non stiamo attenti.\n\nCi sono dei barili di polvere da sparo sotto ai capanni e accanto ai mulini. Prendili e lanciali sulle teste degli Abomini. Io mi occuperò del resto con questo vecchio e fidato schioppo.",
