				["36471"] = {
					["Text"] = {
						["1"] = "Guardami. Ora guarda il mio cavallo. Ora guarda di nuovo me. Non sono forse il più incredibile allenatore di mascotte che tu abbia mai visto?\n\nOra guarda il mio compatriota laggiù. È forse su un cavallo? Certo che no! Il suo cappello è fatto di fuochi d'artificio? Ma neanche per sogno! Io sono assolutamente più incredibile, senza ombra di dubbio, dal colore del mio vestito al mio cognome, che modestamente ho inventato io stesso.\n\nIntendi sfidare il potente Christoph Willikens Dennis Ragnaros VonFeasel Primo?\n\nVedo che stai già tremando!",
