							["count"] = 3,
							["3"] = 8,
							["2"] = "Interface\\Icons\\inv_misc_coin_18",
						}, -- [1]
					},
					["Text"] = {
						["1"] = "Sei pronta a mettere alla prova le tue mascotte? L'arena di combattimento delle mascotte non è il posto adatto per i principianti, spero tu ne sia all'altezza e che sia pronta all'azione. Se possiedi almeno tre mascotte di livello massimo, ti suggerisco di cercare allenatori di pari livello per mostrare al mondo le tue qualità. Potrai trovare le istruzioni nel tuo Diario delle mascotte.",
						["count"] = 2,
						["2"] = "Sconfiggi 10 giocatori tramite \"Trova scontro\" con una squadra composta solo da mascotte di livello 25.",
					},
					["RewardXP"] = 450,
					["RewardMoney"] = 100,
				},
				["29521"] = {
					["RewardMoney"] = 25,
					["Text"] = {
						["1"] = "È importante riportare indietro sani e salvi i tre spiriti rimasti. La mia età avanzata non me lo consente. Nonostante Aysa e Ji possiedano la forza necessaria, sono troppo legati ai loro ideali per riuscire nell'impresa.\n\nTu possiedi le qualità di un'eroina e un equilibrio che a loro manca, quindi devi occupartene tu.\n\nShu, lo Spirito dell'Acqua, si trova presso i Laghetti dei Mille Canti a est. Raggiungi lì Aysa e cercalo insieme a lei. Contiamo su di te.",
						["count"] = 2,
						["2"] = "Parla con Aysa Canta Nubi ai Laghetti dei Mille Canti.",
