					["Link"] = "|cffffff00|Hquest:38560:100|h[Campagna della Guarnigione: Anatema dei Guerci Insanguinati]|h|r",
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Comandante, ora che abbiamo avuto il tempo di inviare i nostri esploratori nella giungla, abbiamo novità dalla zona che circonda Zeth'gol.\r\n\r\nSembra che qualcuno voglia vendicarsi dei Guerci Insanguinati e li stia... cacciando. I loro cacciatori si stanno avvicinando all'assassino, e sai cosa si dice riguardo ai \"nemici dei nostri nemici\"...\r\n\r\nLa cosa migliore che possiamo fare è recuperare le loro mappe e trovare l'assassino prima di loro!",
						["count"] = 2,
						["2"] = "Recupera le mappe per scoprire dove si nasconde l'assassino.",
					},
