					},
					["Link"] = "|cffffff00|Hquest:37030:100|h[Il Sigillo della Mano Nera (Eroica)]|h|r",
					["RewardMoney"] = 616000,
					["Text"] = {
						["1"] = "<Goraluk sospira per il... sollievo? O forse per il rimpianto?>\n\nUn tempo attraversavo queste sale con orgoglio, con la testa alta come un Orco del Clan Roccianera. Ma questa non è la strada giusta da seguire. I nostri martelli sono fatti per forgiare asce, spade... non le macchine di questi stranieri!\n\nNon riusciremo a convincere il Signore della Guerra, se non con la forza. Recupera le essenze dei guardiani più potenti della Fonderia e creerò un sigillo che ti permetterà di ottenere l'accesso diretto al Crogiolo di Manonera.",
						["count"] = 2,
						["2"] = "Recupera 4 Braci della Montagna, 4 Cuori di Pietra e 4 Frammenti di Ferro dai boss finali di ogni ala della Fonderia dei Roccianera in modalità Eroica.",
					},
					["RewardSpell"] = {
