					},
					["Link"] = "|cffffff00|Hquest:37768:100|h[Mastio dell'Imperatore: Imperatore Mar'gok]|h|r",
					["RewardMoney"] = 616000,
					["Text"] = {
						["1"] = "Non ho mai avuto molta considerazione per gli Ogre... almeno finché non ho assistito alla marcia di una legione di Altomaglio! Era come vedere un muro di muscoli corazzati, protetti dalla magia dei migliori stregoni dell'imperatore. Mai sottovalutare un Ogre.\n\nL'Imperatore Mar'gok è la guida suprema di Altomaglio. È un tipo astuto, alleato con l'Orda di Ferro. Se vogliamo distruggere questa alleanza, dobbiamo iniziare dai piani alti.\n\nVai ad Altomaglio e sconfiggi l'Imperatore Mar'gok!",
