					["Text"] = {
						["1"] = "I modelli Orotron non hanno mai sfondato davvero sul mercato fino all'avvento della serie 4000. In pochi ormai ricordano Orotron 3000, una vera meraviglia tecnologica!\n\nLa Carta Sfida che hai sbloccato ti dà la possibilità di sfidare Orotron 3000 proprio qui, al Circolo dei Combattenti.\n\nChe fortuna!",
