						["1"] = "Il Kirin Tor ha creato un avamposto a Gorgrond con un portale per Roccavento in grado di facilitare il passaggio di rinforzi per l'assalto alla Fonderia dei Roccianera. Sfortunatamente, hanno scelto di costruirlo nel cuore di Verdeterno, dimora dei Botani e del più potente dei Genesauri, Yalnu.\n\nL'avamposto è stato già invaso e ormai è solo una questione di tempo prima che quelle piante raggiungano anche Roccavento... e da lì l'intera Azeroth.",
